using System.Net;
using System.Text;
using System.Text.Encodings.Web;
using System.Text.Json;
using FluentAssertions;
using Shared.Results;
using Web.Api.ViewModels.DeliveryPeople;

namespace FunctionalTests.DeliveryPeople.UpdateDriversLicense;

public class UpdateDeliveryPersonDriversLicenseTest
{
    private readonly HttpClient httpClient = new() { BaseAddress = new Uri(Settings.Url) };

    [Fact]
    public async Task Handle_ShouldUpdateDeliveryPersonDriversLicense()
    {
        // Arrange
        var viewModel = new CreateDeliveryPersonViewModel
        {
            Identifier = Guid.NewGuid().ToString(),
            Name = Guid.NewGuid().ToString(),
            Ein = Guid.NewGuid().ToString(),
            DateOfBirth = DateTime.Now,
            DriversLicenseNumber = Guid.NewGuid().ToString(),
            DriversLicenseType = "A",
            DriversLicenseImage =
                "data:image/png;base64,"
        };

        var content = new StringContent(JsonSerializer.Serialize(viewModel, new JsonSerializerOptions { Encoder = JavaScriptEncoder.UnsafeRelaxedJsonEscaping }), Encoding.UTF8, "application/json");
        await httpClient.PostAsync("/entregadores", content);

        var updatedViewModel = new UpdateDeliveryPersonDriversLicenseViewModel
        {
            DriversLicenseImage =
                "data:image/png;base64,"
        };
        content = new StringContent(JsonSerializer.Serialize(updatedViewModel, new JsonSerializerOptions { Encoder = JavaScriptEncoder.UnsafeRelaxedJsonEscaping }), Encoding.UTF8, "application/json");
        // Act
        var response = await httpClient.PostAsync($"/entregadores/{viewModel.Identifier}/cnh", content);

        // Assert
        response.StatusCode.Should().Be(HttpStatusCode.Created);
    }

    [Fact]
    public async Task Handle_ShouldUpdateDeliveryPersonDriversLicenseThatNotExist()
    {
        // Arrange
        var viewModel = new CreateDeliveryPersonViewModel
        {
            Identifier = Guid.NewGuid().ToString(),
            Name = Guid.NewGuid().ToString(),
            Ein = Guid.NewGuid().ToString(),
            DateOfBirth = DateTime.Now,
            DriversLicenseNumber = Guid.NewGuid().ToString(),
            DriversLicenseType = "A",
            DriversLicenseImage =
                "data:image/png;base64,"
        };

        var content = new StringContent(JsonSerializer.Serialize(viewModel, new JsonSerializerOptions { Encoder = JavaScriptEncoder.UnsafeRelaxedJsonEscaping }), Encoding.UTF8, "application/json");
        await httpClient.PostAsync("/entregadores", content);

        var updatedViewModel = new UpdateDeliveryPersonDriversLicenseViewModel
        {
            DriversLicenseImage =
                "data:image/png;base64,"
        };
        content = new StringContent(JsonSerializer.Serialize(updatedViewModel, new JsonSerializerOptions { Encoder = JavaScriptEncoder.UnsafeRelaxedJsonEscaping }), Encoding.UTF8, "application/json");
        // Act
        var response = await httpClient.PostAsync($"/entregadores/xyz/cnh", content);
        var json = await response.Content.ReadAsStringAsync();
        var messageResult = JsonSerializer.Deserialize<MessageResult>(json, new JsonSerializerOptions { Encoder = JavaScriptEncoder.UnsafeRelaxedJsonEscaping, PropertyNameCaseInsensitive = true });

        // Assert
        response.StatusCode.Should().Be(HttpStatusCode.BadRequest);
        messageResult?.Mensagem.Should().Be("Dados invlidos");
    }

